INSERT INTO `t_plat_plt` (`plt_id`, `plt_nom`, `plt_description`, `plt_prix`, `rst_id`, `pht_id`) VALUES
(1, 'Blanquette de veau', 'La blanquette ou blanquette de veau ou blanquette de veau à lancienne est une recette de cuisine traditionnelle de cuisine française, à base de viande de veau cuite dans un bouillon avec carotte, poireau, oignon et bouquet garni, liée en sauce blanche à la crème et au beurre et aux champignons de Paris. ', 12.5, 2, 1),
(2, 'Lasagnes à la bolognaise', 'Les lasagnes sont des pâtes alimentaires en forme de larges plaques. Il sagit également de la préparation utilisant ces mêmes pâtes et généralement faite de couches alternées de pâtes, de fromage et dune sauce tomate avec de la viande, bien quil en existe au poisson, notamment au saumon, et végétariennes.', 11, 1, 4),
(3, 'Filet mignon en croûte', 'Le filet mignon désigne une pièce de viande de porc, de veau, de bœuf et, plus rarement, de chevreuil, correspondant au muscle ilio-psoas, composé des muscles iliaque et grand psoas, entre lesquels chemine le nerf fémoral. Cest une des parties les plus tendres et souvent une des plus chères.', 16, 1, 2),
(4, 'Hachis Parmentier', 'Le hachis Parmentier, ou hachis parmentier, est un plat à base de purée de pommes de terre et de viande de bœuf hachée. Ce gratin doit son nom à lapothicaire, Antoine Parmentier, qui, convaincu que le tubercule pouvait combattre efficacement la disette, le fit goûter à Louis XVI.', 9.99, 1, 3);

